INSERT INTO `templates` (`id`, `name`, `description`, `previewImage`, `htmlTemplate`, `cssStyles`, `isActive`, `category`, `usageCount`, `createdAt`, `updatedAt`) VALUES
(1, 'Professional', 'A clean and professional CV template suitable for most industries', NULL, '\n            <div class=\"cv-container\">\n              <header class=\"cv-header\">\n                <h1 class=\"name\">{{firstName}} {{lastName}}</h1>\n                <div class=\"contact-info\">\n                  <div class=\"contact-item\">{{email}}</div>\n                  <div class=\"contact-item\">{{phone}}</div>\n                  <div class=\"contact-item\">{{city}}, {{country}}</div>\n                </div>\n              </header>\n              \n              {{#if summary}}\n              <section class=\"cv-section\">\n                <h2>Professional Summary</h2>\n                <p>{{summary}}</p>\n              </section>\n              {{/if}}\n              \n              {{#if experience.length}}\n              <section class=\"cv-section\">\n                <h2>Work Experience</h2>\n                {{#each experience}}\n                <div class=\"experience-item\">\n                  <h3>{{jobTitle}} - {{company}}</h3>\n                  <div class=\"date-location\">{{startDate}} - {{#if isCurrentJob}}Present{{else}}{{endDate}}{{/if}} | {{location}}</div>\n                  <p>{{description}}</p>\n                  {{#if achievements.length}}\n                  <ul>\n                    {{#each achievements}}\n                    <li>{{this}}</li>\n                    {{/each}}\n                  </ul>\n                  {{/if}}\n                </div>\n                {{/each}}\n              </section>\n              {{/if}}\n              \n              {{#if education.length}}\n              <section class=\"cv-section\">\n                <h2>Education</h2>\n                {{#each education}}\n                <div class=\"education-item\">\n                  <h3>{{degree}} in {{fieldOfStudy}}</h3>\n                  <div class=\"institution\">{{institution}} | {{location}}</div>\n                  <div class=\"date\">{{startDate}} - {{#if isCurrentlyStudying}}Present{{else}}{{endDate}}{{/if}}</div>\n                  {{#if gpa}}<div class=\"gpa\">GPA: {{gpa}}</div>{{/if}}\n                </div>\n                {{/each}}\n              </section>\n              {{/if}}\n              \n              {{#if skills.length}}\n              <section class=\"cv-section\">\n                <h2>Skills</h2>\n                <div class=\"skills-grid\">\n                  {{#each skills}}\n                  <div class=\"skill-item\">\n                    <span class=\"skill-name\">{{name}}</span>\n                    <span class=\"skill-level\">{{level}}</span>\n                  </div>\n                  {{/each}}\n                </div>\n              </section>\n              {{/if}}\n              \n              {{#if projects.length}}\n              <section class=\"cv-section\">\n                <h2>Projects</h2>\n                {{#each projects}}\n                <div class=\"project-item\">\n                  <h3>{{name}}</h3>\n                  <p>{{description}}</p>\n                  {{#if technologies.length}}\n                  <div class=\"technologies\">\n                    <strong>Technologies:</strong> {{join technologies \", \"}}\n                  </div>\n                  {{/if}}\n                </div>\n                {{/each}}\n              </section>\n              {{/if}}\n            </div>\n          ', '\n            .cv-container {\n              max-width: 800px;\n              margin: 0 auto;\n              padding: 40px;\n              font-family: \'Arial\', sans-serif;\n              line-height: 1.6;\n              color: #333;\n            }\n            \n            .cv-header {\n              text-align: center;\n              margin-bottom: 40px;\n              border-bottom: 2px solid #2c3e50;\n              padding-bottom: 20px;\n            }\n            \n            .name {\n              font-size: 2.5em;\n              margin: 0 0 10px 0;\n              color: #2c3e50;\n              font-weight: bold;\n            }\n            \n            .contact-info {\n              display: flex;\n              justify-content: center;\n              gap: 20px;\n              flex-wrap: wrap;\n            }\n            \n            .contact-item {\n              color: #666;\n              font-size: 0.9em;\n            }\n            \n            .cv-section {\n              margin-bottom: 30px;\n            }\n            \n            .cv-section h2 {\n              color: #2c3e50;\n              border-bottom: 1px solid #bdc3c7;\n              padding-bottom: 5px;\n              margin-bottom: 20px;\n              font-size: 1.3em;\n            }\n            \n            .experience-item, .education-item, .project-item {\n              margin-bottom: 25px;\n            }\n            \n            .experience-item h3, .education-item h3, .project-item h3 {\n              color: #34495e;\n              margin: 0 0 5px 0;\n              font-size: 1.1em;\n            }\n            \n            .date-location, .institution, .date {\n              color: #7f8c8d;\n              font-size: 0.9em;\n              margin-bottom: 10px;\n            }\n            \n            .skills-grid {\n              display: grid;\n              grid-template-columns: repeat(auto-fit, minmax(200px, 1fr));\n              gap: 10px;\n            }\n            \n            .skill-item {\n              display: flex;\n              justify-content: space-between;\n              padding: 8px 12px;\n              background: #f8f9fa;\n              border-radius: 4px;\n            }\n            \n            .skill-name {\n              font-weight: 500;\n            }\n            \n            .skill-level {\n              color: #666;\n              font-size: 0.9em;\n            }\n            \n            .technologies {\n              margin-top: 10px;\n              font-size: 0.9em;\n              color: #666;\n            }\n            \n            ul {\n              margin: 10px 0;\n              padding-left: 20px;\n            }\n            \n            li {\n              margin-bottom: 5px;\n            }\n            \n            @media print {\n              .cv-container {\n                padding: 20px;\n              }\n            }\n          ', 1, 'professional', 0, '2025-09-09 19:48:55', '2025-09-09 19:48:55'),
(2, 'Modern', 'A modern and stylish CV template with contemporary design', NULL, '\n            <div class=\"cv-container modern\">\n              <div class=\"sidebar\">\n                <div class=\"profile-section\">\n                  <h1 class=\"name\">{{firstName}}<br>{{lastName}}</h1>\n                  <div class=\"contact-info\">\n                    <div class=\"contact-item\"> {{email}}</div>\n                    <div class=\"contact-item\"> {{phone}}</div>\n                    <div class=\"contact-item\"> {{city}}, {{country}}</div>\n                  </div>\n                </div>\n                \n                {{#if skills.length}}\n                <div class=\"sidebar-section\">\n                  <h2>Skills</h2>\n                  {{#each skills}}\n                  <div class=\"skill-item\">\n                    <div class=\"skill-name\">{{name}}</div>\n                    <div class=\"skill-level-bar\">\n                      <div class=\"skill-progress {{level}}\"></div>\n                    </div>\n                  </div>\n                  {{/each}}\n                </div>\n                {{/if}}\n              </div>\n              \n              <div class=\"main-content\">\n                {{#if summary}}\n                <section class=\"section\">\n                  <h2>About Me</h2>\n                  <p>{{summary}}</p>\n                </section>\n                {{/if}}\n                \n                {{#if experience.length}}\n                <section class=\"section\">\n                  <h2>Experience</h2>\n                  {{#each experience}}\n                  <div class=\"timeline-item\">\n                    <div class=\"timeline-marker\"></div>\n                    <div class=\"timeline-content\">\n                      <h3>{{jobTitle}}</h3>\n                      <h4>{{company}}</h4>\n                      <div class=\"date\">{{startDate}} - {{#if isCurrentJob}}Present{{else}}{{endDate}}{{/if}}</div>\n                      <p>{{description}}</p>\n                    </div>\n                  </div>\n                  {{/each}}\n                </section>\n                {{/if}}\n                \n                {{#if education.length}}\n                <section class=\"section\">\n                  <h2>Education</h2>\n                  {{#each education}}\n                  <div class=\"education-item\">\n                    <h3>{{degree}} in {{fieldOfStudy}}</h3>\n                    <div class=\"institution\">{{institution}}</div>\n                    <div class=\"date\">{{startDate}} - {{#if isCurrentlyStudying}}Present{{else}}{{endDate}}{{/if}}</div>\n                  </div>\n                  {{/each}}\n                </section>\n                {{/if}}\n              </div>\n            </div>\n          ', '\n            .cv-container.modern {\n              display: flex;\n              max-width: 1000px;\n              margin: 0 auto;\n              font-family: \'Segoe UI\', Tahoma, Geneva, Verdana, sans-serif;\n              min-height: 100vh;\n            }\n            \n            .sidebar {\n              width: 300px;\n              background: linear-gradient(135deg, #667eea 0%, #764ba2 100%);\n              color: white;\n              padding: 40px 30px;\n            }\n            \n            .profile-section {\n              text-align: center;\n              margin-bottom: 40px;\n            }\n            \n            .name {\n              font-size: 2em;\n              margin: 0 0 20px 0;\n              font-weight: 300;\n              line-height: 1.2;\n            }\n            \n            .contact-info {\n              text-align: left;\n            }\n            \n            .contact-item {\n              margin-bottom: 10px;\n              font-size: 0.9em;\n            }\n            \n            .sidebar-section {\n              margin-bottom: 30px;\n            }\n            \n            .sidebar-section h2 {\n              font-size: 1.2em;\n              margin-bottom: 20px;\n              font-weight: 500;\n            }\n            \n            .skill-item {\n              margin-bottom: 15px;\n            }\n            \n            .skill-name {\n              font-size: 0.9em;\n              margin-bottom: 5px;\n            }\n            \n            .skill-level-bar {\n              height: 4px;\n              background: rgba(255,255,255,0.3);\n              border-radius: 2px;\n              overflow: hidden;\n            }\n            \n            .skill-progress {\n              height: 100%;\n              background: white;\n              border-radius: 2px;\n            }\n            \n            .skill-progress.Beginner { width: 25%; }\n            .skill-progress.Intermediate { width: 50%; }\n            .skill-progress.Advanced { width: 75%; }\n            .skill-progress.Expert { width: 100%; }\n            \n            .main-content {\n              flex: 1;\n              padding: 40px;\n              background: white;\n            }\n            \n            .section {\n              margin-bottom: 40px;\n            }\n            \n            .section h2 {\n              color: #333;\n              font-size: 1.5em;\n              margin-bottom: 25px;\n              position: relative;\n              padding-bottom: 10px;\n            }\n            \n            .section h2:after {\n              content: \'\';\n              position: absolute;\n              bottom: 0;\n              left: 0;\n              width: 50px;\n              height: 3px;\n              background: linear-gradient(135deg, #667eea 0%, #764ba2 100%);\n            }\n            \n            .timeline-item {\n              position: relative;\n              padding-left: 30px;\n              margin-bottom: 30px;\n            }\n            \n            .timeline-marker {\n              position: absolute;\n              left: 0;\n              top: 5px;\n              width: 12px;\n              height: 12px;\n              background: #667eea;\n              border-radius: 50%;\n            }\n            \n            .timeline-marker:before {\n              content: \'\';\n              position: absolute;\n              left: 5px;\n              top: 12px;\n              width: 2px;\n              height: 60px;\n              background: #e0e0e0;\n            }\n            \n            .timeline-content h3 {\n              color: #333;\n              margin: 0 0 5px 0;\n              font-size: 1.1em;\n            }\n            \n            .timeline-content h4 {\n              color: #667eea;\n              margin: 0 0 5px 0;\n              font-weight: 500;\n            }\n            \n            .date {\n              color: #666;\n              font-size: 0.9em;\n              margin-bottom: 10px;\n            }\n            \n            .education-item {\n              margin-bottom: 25px;\n            }\n            \n            .education-item h3 {\n              color: #333;\n              margin: 0 0 5px 0;\n            }\n            \n            .institution {\n              color: #667eea;\n              font-weight: 500;\n              margin-bottom: 5px;\n            }\n          ', 1, 'modern', 0, '2025-09-09 19:48:55', '2025-09-09 19:48:55');

